def calculate_approval_probability(n, k, A, senators):
    mx_bribe = sum(((100 - loy) // 10 for (_, loy) in senators))
    bribe = [0] / n

    def calc(votes):
        (bsum, cnt, p) = (0, 0, 1.0)
        for (i, (lvl, loy)) in enumerate(senators):
            if votes & 1 << i:
                p *= (loy + bribe[i]) / 100
                cnt += 1
            else:
                p *= (100 - loy - bribe[i]) / 100
                bsum += lvl
        if cnt > n / 2:
            return p
        else:
            return p * A / (A + bsum)

    def dfs(cur, rk):
        if cur >= n:
            if rk > 0:
                return 0.0
            sm = 0.0
            for i in range(1 << n):
                sm += calc(i)
            return sm
        mx = 0.0
        for i in range(rk + 1):
            if i * 10 + senators[cur][1] > 100:
                break
            bribe[cur] = i * 10
            tmp = dfs(cur + 1, rk - i)
            mx = max(tmp, mx)
        return mx
    return dfs(0, min(k, mx_bribe))

